public static Date parseDate(String d, Collection<String> fmts) throws ParseException {
  // 2007-04-26T08:05:04Z
  if (d.endsWith("Z") && d.length() > 20) {
    return getThreadLocalDateFormat().parse(d);
  }
  return parseDate(d, fmts, null);
}

